description.text:
My daughter wanted a gift for her classmates for Valentine's day, so I whipped up this heart with a message on it. She liked it, so I thought I'd post it for everyone.   
I made it customizable so you can put in whatever message you want.  
In case you don't want to customize, I've uploaded stl's of &quot;I love you&quot; and &quot;My friend&quot;
